  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hi: <button onClick={startHandler}>aa</button>
          <Timer onStart={startHandler} onStop={stopHandler} />
        </p>
      </header>
    </div>
  );
}

export default App;
